//export default App;
import { createBrowserRouter, RouterProvider, } from 'react-router-dom';


const router = createBrowserRouter([
  {
    path: '/', 
    element: <RootLayout />,
    children: [
      { path: '/home', element: <Home />},
      { path: '/yourbooking', element: <Yourbooking />},
      { path: '/selectnewbooking', element: <Selectnewbooking />},
      { path: '/seatbooking', element: <Seatbooking />},
      { path: '/parkingseat', element: <Parkingseat />},
      { path: '/Final/:selected/:totalprice', element: <Final />}
    ]
  }
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
